import React from 'react';

class MainPageBottom extends React.Component {
  render() {
    return (
      <div className="bottom-container">
        <img src="/assets/images/profferly_logo_white_small.png" />
        <h3>profferly</h3>
        <h5>
          Where volunteers unite to inspire and help others accomplish their goal.
        </h5>
        <p>
          Born out of the coronavirus pandemic, the idea behind profferly started with the recognized need for lending hands. Whether you are looking for an opportunity to help or looking to help, profferly is about connecting volunteering opportunities with those who can serve to ultimately strengthen the bonds of community.
        </p>
      </div>
    )
  }
}

export default MainPageBottom;
